import { useEffect, useState } from "react";
import { NavLink } from "react-router-dom";
import { User } from "../../types/models";
import "./Levels.css";

interface LevelProps {
    // user: User | null;
}

const Level2 = (props: LevelProps): JSX.Element => {
    // const { user } = props;
    const [completed, setCompleted] = useState(false);
    const [scenario, setScenario] = useState({
        created: false,
        nMoons: 0,
        moons: [],
        buttons: [],
        correct: "",
    });

    const [wrong, setWrong] = useState("");
    // const planet = ":)";
    const planet = (
        <>
            <g clip-path="url(#clip0_175_2813)">
                <path d="M277 0H0V277H277V0Z" fill="url(#pattern0)" />
            </g>
            <defs>
                <pattern
                    id="pattern0"
                    patternContentUnits="objectBoundingBox"
                    width="1"
                    height="1"
                >
                    <use
                        xlinkHref="#image0_175_2813"
                        transform="scale(0.00294118)"
                    />
                </pattern>
                <clipPath id="clip0_175_2813">
                    <rect width="277" height="277" fill="white" />
                </clipPath>
                <image
                    id="image0_175_2813"
                    width="340"
                    height="340"
                    xlinkHref="data:image/png;base64,"
                />
            </defs>
        </>
    );
    const moon = (
        <svg
            width="3rem"
            height="3rem"
            viewBox="0 0 58 58"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
            xmlnsXlink="http://www.w3.org/1999/xlink"
        >
            <rect width="58" height="58" fill="url(#pattern1)" />
            <defs>
                <pattern
                    id="pattern1"
                    patternContentUnits="objectBoundingBox"
                    width="1"
                    height="1"
                >
                    <use
                        xlinkHref="#image0_175_2826"
                        transform="scale(0.00195312)"
                    />
                </pattern>
                <image
                    id="image0_175_2826"
                    width="512"
                    height="512"
                    xlinkHref="data:image/png;base64,"
                />
            </defs>
        </svg>
    );
    // const moon = ":)";
    const allMoons = {
        0: (
            <div key="0" className="moon absolute top-3 right-24">
                {moon}
            </div>
        ),
        3: (
            <div key="3" className="moon absolute top-8 right-5">
                {moon}
            </div>
        ),
        2: (
            <div key="2" className="moon absolute bottom-16 right-2">
                {moon}
            </div>
        ),
        1: (
            <div key="1" className="moon absolute bottom-10 left-6">
                {moon}
            </div>
        ),
    };
    const createScenario = () => {
        const nMoons = Math.floor(Math.random() * 4) + 1;
        let numbers = [1, 2, 3, 4];
        let sliced = numbers.slice(0, nMoons);
        let moons = [];
        let shuffledButtons = [];
        console.log("sliced array  ", sliced);
        for (let i = 0; i < 4; i++) {
            let randomIndex = Math.floor(Math.random() * numbers.length);
            shuffledButtons.push(numbers[randomIndex]);
            numbers.splice(randomIndex, 1);
            if (i < nMoons) {
                console.log(i, "");
                moons.push(allMoons[i]);
            }
        }
        console.log(shuffledButtons);
        console.log(moons);
        console.log(nMoons);
        const generated = {
            created: true,
            nMoons: nMoons,
            moons: moons,
            buttons: shuffledButtons,
            correct: nMoons.toString(),
        };
        setScenario(generated);
    };
    useEffect(() => {
        createScenario();
    }, []);
    const handleButton = (e: any) => {
        console.log(e.target.id);
        if (e.target.id == scenario.correct) {
            setCompleted(true);
        } else {
            setWrong(e.target.id);
            setTimeout(() => {
                setWrong("");
            }, 2000);
        }
    };

    const images = (
        <div
            className={
                "relative w-72 h-[24rem] flex flex-col items-center justify-center"
            }
        >
            <div className="h-full flex justify-center items-center">
                <svg
                    width="14rem"
                    height="14rem"
                    viewBox="0 0 277 277"
                    fill="none"
                    xmlns="http://www.w3.org/2000/svg"
                    xmlnsXlink="http://www.w3.org/1999/xlink"
                >
                    {planet}
                </svg>
                {scenario.created && scenario.moons.map((moon) => moon)}
            </div>
        </div>
    );
    useEffect(() => {
        if (completed == true) {
            // FETCH TO CREATE THE LEVEL COMPLETED ?
            console.log("pushing data");
        }
    }, [completed]);
    if (completed == true) {
        return (
            <div
                className={
                    "flex font-nunito flex-col justify-start items-center sm:justify-center pt-12 md:pt-0 h-[100vh] w-full gap-1 success-screen"
                }
            >
                <div className="text-3xl h-16 text-white">Stellar Work!</div>

                {/* Planet Holder */}
                {/* {images} */}
                {images}
                {/* Button Options */}
                <div className="flex gap-6 flex-col justify-center">
                    <NavLink to="/completed">
                        <button className="h-12 w-64 rounded rounded-[1rem] text-xl text-white bg-beyondBlue my-2">
                            Continue
                        </button>
                    </NavLink>
                </div>
            </div>
        );
    } else {
        return (
            <div
                className={
                    "flex font-nunito flex-col justify-start items-center sm:justify-center pt-12 md:pt-0 h-[100vh] w-full gap-1 "
                }
            >
                <NavLink to="/worlds">
                    <div className="absolute top-0 left-0 p-6 ">
                        <svg
                            xmlns="http://www.w3.org/2000/svg"
                            fill="none"
                            viewBox="0 0 24 24"
                            strokeWidth={1}
                            stroke="currentColor"
                            className="w-10 h-10"
                        >
                            <path
                                strokeLinecap="round"
                                strokeLinejoin="round"
                                d="M6 18L18 6M6 6l12 12"
                            />
                        </svg>
                    </div>
                </NavLink>

                {/* Planet Holder */}
                {images}

                {/* Button Options */}
                <div className="flex gap-6 flex-col justify-center">
                    <>
                        <div className="px-10 text-md font-bold text-center">
                            {" "}
                            How many moons are there?
                        </div>
                        <div className="flex gap-6 justify-center">
                            {scenario.created &&
                                scenario.buttons.map((button) => (
                                    <button
                                        className={
                                            "rounded h-14 w-10 text-2xl font-bolder " +
                                            (button == wrong
                                                ? " animate-bounce bg-red-100"
                                                : " bg-asteroidGray")
                                        }
                                        onClick={handleButton}
                                        id={button}
                                    >
                                        {button}
                                    </button>
                                ))}
                        </div>
                    </>
                </div>
            </div>
        );
    }
};
export default Level2;
